import React, { useState } from 'react';
import axios from 'axios';
//stepper
import { makeStyles } from '@material-ui/core/styles';
import Stepper from '@material-ui/core/Stepper';
import Step from '@material-ui/core/Step';
import StepButton from '@material-ui/core/StepButton';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';

const useStyles = makeStyles((theme) => ({
	root: {
	  width: '100%',
	},
	button: {
	  marginRight: theme.spacing(1),
	},
	completed: {
	  display: 'inline-block',
	},
	instructions: {
	  marginTop: theme.spacing(1),
	  marginBottom: theme.spacing(1),
	},
  }));
 
function getSteps() {
return ['Upload CSV file', 'Choose variables', 'Choose type of graphicon'];
}

function getStepContent(step) {
	switch (step) {
	  case 0:
		return (<Button>sss</Button>);
	  case 1:
		return 'Step 2: What is an ad group anyways?';
	  case 2:
		return 'Step 3: This is the bit I really care about!';
	  default:
		return 'Unknown step';
	}
  }



//logic
const Upload = () => {
//stepper p2
	const classes = useStyles();
	const [activeStep, setActiveStep] = React.useState(0);
	const [completed, setCompleted] = React.useState({});
	const steps = getSteps();

	const totalSteps = () => {
		return steps.length;
	  };

	const completedSteps = () => {
		return Object.keys(completed).length;
	  };

	const isLastStep = () => {
	return activeStep === totalSteps() - 1;
	};

	const allStepsCompleted = () => {
	return completedSteps() === totalSteps();
	};

	const handleNext = () => {
		const newActiveStep =
		  isLastStep() && !allStepsCompleted()
			? // It's the last step, but not all steps have been completed,
			  // find the first step that has been completed
			  steps.findIndex((step, i) => !(i in completed))
			: activeStep + 1;
		setActiveStep(newActiveStep);
	  };

	  const handleBack = () => {
		setActiveStep((prevActiveStep) => prevActiveStep - 1);
	  };

	  const handleStep = (step) => () => {
		setActiveStep(step);
	  };
	  
	  const handleComplete = () => {
		const newCompleted = completed;
		newCompleted[activeStep] = true;
		setCompleted(newCompleted);
		handleNext();
	  };
	  const handleReset = () => {
		setActiveStep(0);
		setCompleted({});
	  };
	  //end of steppper
    const [selectedFile, setSelectedFile] = useState();
    const [isFilePicked, setIsFilePicked] = useState(false);
	const [isFileSubmitted, setIsFileSubmitted] = useState(false);
	const [selectedHeaders, setSelectedHeaders] = useState();
	const [isHeaderPicked, setIsHeaderPicked] = useState(false);
	const d = new Date();
	let chosenVariables = [];
	let typesGraphicons = ['Linijski grafikon', 'Histogram','Box plot','Scatter plot', 'Bar plot', 'Heat map'];
	let chosenGraph = -1;
	

	
   
    const changeHandler = (event) => {
		setSelectedFile(event.target.files[0]);
		console.log(event.target.files[0]);
		setIsFilePicked(true);
	};
    //uploading csv to server
    const handleSubmission = () => {
		console.log("handleUpload started");
        const data = new FormData()
        data.append('file', selectedFile)
        axios.post("http://localhost:3001/upload", data, {

        })
        .then(res => {
            console.log(res.statusText);
        })
		
		submit();
		setIsFileSubmitted(true);
	};
	



	//getHeaders from selectedfile csv
	const submit = () => {
        const file = selectedFile;
        const reader = new FileReader();

        reader.onload = function(e) {
            const text = e.target.result;
            console.log(text);
			processCsv(text);
        }

        reader.readAsText(file);
    }
	
	const processCsv = (str, delim=",") => {
		setSelectedHeaders(  str.slice(0,str.indexOf('\r\n')).split(delim));
		setIsHeaderPicked(true);
		console.log(selectedHeaders);
		
	}



	

	const saveChosenVariables = (e) => {
		if(chosenVariables.indexOf(e) === -1){
			chosenVariables.push(e);
			console.log(chosenVariables);
		}
		else if(chosenVariables.indexOf(e) !== -1){
			chosenVariables.splice(chosenVariables.indexOf(e),1);
			console.log(chosenVariables);
		}
		
		
	}

	//Date.now() + '-' + file.originalname
	//putting csvfile name in database
	const handleDatabase = ()=> {
		console.log("handleDB started");
		let csvName = d.getDate() + '-' + (d.getMonth()+1) + '-' + selectedFile.name;
		
		axios.post("http://localhost:3001/list",{
			csvname: csvName,
			graph: chosenGraph,
			var1: chosenVariables[0],
			var2: chosenVariables[1],
			var3: chosenVariables[2],
			var4: chosenVariables[3],
			var5: chosenVariables[4],
		})
		.then(res => {
            console.log(res.statusText);
        })

		
	
		// fetch("http://localhost:3001/list", {
		// 	method: 'POST',
		// 	headers: {
		// 		'Content-Type' : 'application/json',
		// 	},
		// 	body: JSON.stringify({csvName}),
		// }).catch(error => {
		// 	console.log(error);
		// })
		// .then(response => {
		// 	console.log(response);
		// 	return response.text();
		// });
		
	};

    return (
		//stepper html
		<>
		<div className={classes.root}>
			<Stepper nonLinear activeStep={activeStep}>
				{steps.map((label,index) => (
					<Step key={label}>
						<StepButton onClick={handleStep(index)} completed={completed[index]}>
							{label}
						</StepButton>
					</Step>
				))}
			</Stepper>
			<div>
				{allStepsCompleted() ? (
					<div>
						<Typography className={classes.instructions}>
							All steps completed - youre finished
						</Typography>
						<Button onClick={handleReset}>Reset</Button>	
					</div>
				) : (
					<div>
						<Typography className={classes.instructions}>{getStepContent(activeStep)}</Typography>
						<div>
							<Button disabled={activeStep === 0} onClick={handleBack} className={classes.button}>
								Back
							</Button>
							<Button
								variant="contained"
								color="primary"
								onClick={handleNext}
								className={classes.button}>
									Next
								</Button>
							{activeStep !== steps.length &&
								(completed[activeStep] ? (
									<Typography variant="caption" className={classes.completed}>
										Step {activeStep + 1} already completed
									</Typography>
								) : (
									<Button variant="contained" color="primary" onClick={handleComplete}>
										{completedSteps() === totalSteps() - 1 ? 'Finish' : 'Complete Step'}
									</Button>
								))}
						</div>
					</div>
				)}
			</div>
		</div>






		//logic htmnl
        <div>
			<input type="file" name="file" accept=".csv" onChange={changeHandler} />
			{isFilePicked ? (
				<div>
					<p>Filename: {selectedFile.name}</p>
					<p>Filetype: {selectedFile.type}</p>
					<p>Size in bytes: {selectedFile.size}</p>
					<p>
						lastModifiedDate:{' '}
						{selectedFile.lastModifiedDate.toLocaleDateString()}
					</p>
				</div>
			) : (
				<p>Select a file to show details</p>
			)}
			<div>
				<button onClick={ handleSubmission } >Submit</button>
			</div>
			{isFileSubmitted ? (
				<>
				<div> 
					<label>Variables</label>
					{
							isHeaderPicked ? (
								selectedHeaders.map((e,i) => (
										<button key={i} type="button" onClick={()=> {saveChosenVariables(e) }}>{e}</button>))
							) : ( <br/>) 
					
					}
					{console.log(chosenVariables)}
					
				</div>
				<div>
				<label>Graphicons</label>
				{typesGraphicons.map((e,i) => (
					<button key={i} type="button" onClick={() => {chosenGraph = e; console.log(chosenGraph);}}>{e}</button>
				))}

				</div>
				<div>
					<button type="submit" onClick={()=>{handleDatabase()}}>Napravi grafikon</button>
				</div>
				</>
				
			) : ( <br/>) }
			
			
		</div>
		</>
    )
}

export default Upload;
